import "./App.css";

const ItemsPage = () => {
  return <h1>ItemsPage</h1>
}
const App = () => {
  return (
    <div className="App">
      <h1>corkboard</h1>
      <input placeholder="code..."></input>
      <button onClick={ItemsPage()}>Use Code!</button>
      <button>New Code!</button>
    </div>
  );
};

export default App;
